class Solution:
    def maxProduct(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        product = []
        result = max(nums)
        maxNum = nums[0]
        minNum = nums[0]
        for i in range(1, len(nums)):
            if nums[i] < 0:
            	maxNum, minNum = minNum, maxNum
            maxNum = max(nums[i]*maxNum, nums[i])
            minNum = min(nums[i]*minNum, nums[i])
            result = max(maxNum, result)
        return result

